@use './colors' as c;

.parallax {
  &__content {
    min-width: 10rem;
    width: 100%;
    overflow: hidden;
  }

  &__hero {
    position: relative;
    height: 23rem;
    width: 100%;
    color: c.$primary-color;
    background-image: url('../img/parallax.jpg');
    background-position: center;
    background-size: cover;
    z-index: -1;
    &-box {
      display: flex;
      justify-content: center;
      align-items: center;
      margin: 0 auto;
      min-width: 11.5rem;
      width: 43.25rem;
      max-width: 100%;
      height: 100%;
      padding: 0.015rem;
      white-space: wrap;
      &--title {
        padding: 2.15rem;
        width: 85%;
        line-height: 2.5rem;
        border-radius: 0.125rem;
        border: 1px solid c.$parallax-border-color;
        font-size: 1.5rem;
      }
    }
  }
  &__shadow {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(0, 10, 0, 0.7);
    z-index: -1;
  }
}

